            <UserStoriesPhotos photoSrc={require("../Images/inri-cristo.jpg")}  userName="Roberto" />




        </ScrollView>

    </View>
    );
}

const styles = StyleSheet.create({
    container:{
        height:110,
        width:"100%",
        flexDirection:"row",


    }


